def hungarian_matching(cost_list):
    # initialize and fill in the cost matrix
    N = len(cost_list)
    cost_matrix = [0] * N
    for i in range(N):
        cost_matrix[i] = cost_list[i]
    for k in range(N):
        for j in range(k + 1, N):
            if cost_matrix[j] < cost_matrix[k]:
                cost_matrix[k] = cost_matrix[j]

    # perform the sorting and matching
    for k in range(N):
        while True:
            # find the minimum remaining cost
            min_cost = float('inf')
            min_j = -1
            for j in range(k + 1, N):
                if cost_matrix[j] < min_cost:
                    min_cost = cost_matrix[j]
                    min_j = j
            assert 0 <= min_j < N
            # swap the rows and perform matching
            cost_matrix[k], cost_matrix[min_j] = cost_matrix[min_j], cost_matrix[k]
            for j in range(k + 1, N):
                if cost_matrix[j] < 0:
                    cost_matrix[j] += cost_matrix[k]
                elif cost_matrix[j] < cost_matrix[min_j]:
                    cost_matrix[j] += cost_matrix[min_j]
```

